        <div className="underline"></div>
      </div>
         {/* {...tour} agrega todas las propuedades que esten contenidas en el json con tour */}
         <div>
        {tours.map((tour) => {
          return <Tour key={tour.id} {...tour} removeTour={removeTour} />;
        })}
      </div>
    </section>
  );
};

export default Tours;
